const layoutStyle = {
    margin: 20,
    padding: 20,
    border: '1px solid #DDD'
};


const Header = () => (
    <div>
        <h5>Tracker</h5>
        <h5>News</h5>
    </div>
)

export default function Layout({ children }) {
    return (
        <div style={layoutStyle}>
            <Header />
            {props.children}
        </div>
    )
}
